import React from 'react'
import ListLocations from './ListLocations'

describe('<ListLocations />', () => {
  it('renders', () => {
    // see: https://on.cypress.io/mounting-react
    cy.mount(<ListLocations />)
    cy.get('input').type('Yamba').should('have.value', 'Yamba')
    cy.get('button').click()
  })
})
